import React, { useState, useEffect } from 'react';
import axios from 'axios';

const UserList = () => {
  const [state, setstate] = useState({
    loading: false,
    users: [],
    errorMessage: '',
  });

  useEffect(async () => {
    try {
      setstate({ ...state, loading: true });
      const response = await axios.get(
        'https://jsonplaceholder.typicode.com/users'
      );
      setstate({
        ...state,
        loading: false,
        users: response.data,
      });
    } catch (error) {
      setstate({
        ...state,
        loading: false,
        errorMessage: error,
      });
    }
  }, []);
